title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o11958.m12 -> o11936.m15 -> o11958.m12
  o11958.m9 -> o11936.m15 -> o11958.m12 -> o11936.m15
  o11958.m20 -> o11936.m15 -> o11958.m12 -> o11936.m15
  o11936.m15 -> o11958.m12 -> o11936.m15
  o11943.m10 -> o11938.m31 -> o11943.m37 -> o11938.m20 -> o11943.m37
  o11943.m5 -> o11938.m18 -> o11943.m37 -> o11938.m20 -> o11943.m37
  o11938.m20 -> o11943.m37 -> o11938.m20
  o11938.m8 -> o11943.m37 -> o11938.m20 -> o11943.m37
  o11938.m24 -> o11943.m33 -> o11938.m24
  o11938.m28 -> o11938.m18 -> o11943.m37 -> o11938.m20 -> o11943.m37
  o11938.m18 -> o11943.m37 -> o11938.m20 -> o11943.m37
  o11938.m31 -> o11943.m37 -> o11938.m20 -> o11943.m37
  o11943.m33 -> o11938.m24 -> o11943.m33
  o11943.m4 -> o11938.m18 -> o11943.m37 -> o11938.m20 -> o11943.m37
  o11943.m37 -> o11938.m20 -> o11943.m37

features:
  - inheritance
  - overriding
  - method
  - polymorphism

